import {Dialog, withStyles, Box} from '@material-ui/core';

const style = {
    dialogPaper: {
        height: '95%',
        width: '91%',
        overflow: 'hidden',
        borderRadius: 0,
        maxHeight: '100%',
        maxWidth: '100%'
    }
}

const ChatBox = ({ classes }) => {
    return (
        <Dialog
            open={true}
            classes={{ paper: classes.dialogPaper }}
        >
          <Box>
              <Box>
                  Hello
              </Box>
              <Box>
                  Hi
              </Box>
          </Box>
        </Dialog>
    )
}

export default withStyles(style)(ChatBox);
